syntax = "proto3";

import "OnlinePlayerInfo.proto";

message GetOnlinePlayerListRsp {
	enum CmdId {
		option allow_alias = true;
		NONE = 0;
		ENET_CHANNEL_ID = 0;
		ENET_IS_RELIABLE = 1;
		CMD_ID = 63;
	}

	int32 retcode = 9;
	repeated OnlinePlayerInfo player_info_list = 13;
	uint32 param = 5;
}
